import React from "react";
import sofaGreenMaria from "../images/sofaGreenMaria.PNG";
import chairStreetMaria from "../images/chairStreetMaria.PNG";
import sofaOwlMaria from "../images/sofaOwlMaria.PNG";
import index from "../stylesheets/index.css";

function Index() {
  return (
    <div
      className="index-nav"
      class="bg_image"
      style={{
        backgroundImage: `url(${sofaGreenMaria})`,
        backgroundSize: "cover",
        height: "100vh",
      }}
    >
      <div className="lineOne">
        <b>
          <a
            href="/recommendations"
            style={{ fontSize: "1.4rem", margin: "80px" }}
          >
            Recommendations
          </a>
        </b>
        <a href="/soundtracks" style={{ fontSize: "1.4rem", margin: "60px" }}>
          Soundtracks For Sofas
        </a>
      </div>
      <div className="lineTwo">
        <a href="/aboutproject" style={{ fontSize: "2rem", margin: "60px" }}>
          The Sofa Project
        </a>
        <a
          href="/theworldaroundsofa"
          style={{ fontSize: "1.2rem", margin: "120px" }}
        >
          The World Around Sofa
        </a>
      </div>
      <div className="lineThree">
        <a href="/cello" style={{ fontSize: "1.2rem", margin: "140px" }}>
          Cello
        </a>
        <b>
          <a
            href="/aboutartist"
            style={{
              fontSize: "1.2rem",
              margin: "120px",
              paddingTop: "240px",
            }}
          >
            About The Artist
          </a>
        </b>
      </div>
    </div>
    // </div>
  );
}

export default Index;
